Позволяет использовать плагин Blitz Smart Card Plugin для электронных подписейСпециальное расширение Адаптер плагина Blitz требуется для корректной работы плагина Blitz Smart Card Plugin в браузере Google Chrome.
Плагин Blitz Smart Card Plugin совместим с решениями российских производителей ключей электронной подписи и может применяться в информационных системах, в которых используются цифровые сертификаты и инфраструктура PKI.
Плагин позволяет использовать электронные подписи различных типов, в том числе:
- JaCarta PKI / ГОСТ от компании Аладдин Р.Д.;
- eToken ГОСТ от компании Аладдин Р.Д.;
- семейство ключей Рутокен ЭЦП от компании «Актив»;
- ключи на основе КриптоПро CSP 3.9 и 4.0;
- ключи на основе Signal-COM CSP 3.0;
- ключи ESMART от компании ISBC;
- SafeNet eToken.
Точный перечень устройств зависит от операционной системы. Подробная информация о плагине размещена на странице продукта.

Позволяет использовать Рутокен ПлагинРутокен Плагин — это программа, которая в сочетании с токенами и смарт-картами Рутокен ЭЦП 2.0/3.0/PKI является комплексным решением для электронной подписи и двухфакторной аутентификации в браузере.

Рутокен Плагин помогает:
1) Сохранить удобство использования сайта для клиентов;
2) Снизить затраты на внедрение и использование электронной подписи;
3) Исключить риск подбора логина-пароля в личном кабинете.

Взаимодействие в браузере происходит через JavaScript API. Есть инструменты для:
1) Создания запросов и записи сертификатов;
2) Вычисления электронной подписи разными алгоритмами;
Шифрования;
3) Управления PIN-кодами, ключами и сертификатами RSA- и ГОСТ-2012 на устройствах;
4) Работы со средствами визуализации и контроля подписываемых данных;
5) Добавления в подпись информации о времени и месте подписания для антифрод анализа.

При установке Рутокен Плагин не требует полномочий администратора системы и использует только встроенные в браузер возможности и API. Подойдет любой компьютер под управлением ОС Windows, macOS или Linux с популярным браузером.

Выполняет анализ просматриваемых веб-страниц и добавляет в контекстное меню пункты открывающие анализ страницы в валидаторах.Это расширение будет полезно для вебмастеров, владельцев и администраторов сайтов, верстальщиков и фронтендеров.

  Расширение выполняет анализ просматриваемых веб-страниц, а так же добавляет в контекстное меню браузера Google Chrome пункты меню, открывающие анализ просматриваемой страницы сайта в сервисах:

 - Google PageSpeed (скорость страницы сайта);
 - Валидатор HTML (анализ HTML-кода страницы сайта);
 - Валидатор CSS (анализ кода всех стилей CSS подключаемых к странице сайта);
 - Валидатор микроразметки;
 - Проверка иконок сайта;
 - Яндекс ИКС;
 - Alexa Ranks.

В панели настроек Вы всегда можете отключить ненужные для вас пункты меню.

