Создавайте партнёрские ссылки в один клик и зарабатывайте на своем контентеАссистент для партнёров Яндекс.Маркета (0+) — это расширение для браузера, упрощающее работу с инструментами партнёрской сети. Легко создавайте партнёрские ссылки: открываете любую страницу Маркета, нажимаете на иконку расширения, копируете готовую ссылку и вставляете туда, где она нужна.
Сейчас ассистент может:
— в один клик создавать короткие партнёрские ссылки для любых страниц Яндекс.Маркета;
— работать сразу с несколькими вашими площадками;
— размечать ссылки дополнительными идентификаторами;
— сохранять историю созданных ссылок.
Размещение ссылок в вашем контенте даёт вам возможность зарабатывать с каждого клика по ним. Оплата происходит за переходы в магазины из Маркета, а также за оформленные и подтвержденные заказы на самом Маркете.

Ассистент для упрощения работы с плеером сайта Аудиокниги.Клуб- Работает в фоне;
- Можно останавливать/запускать плеер из любого места;
- Есть поддержка горячих клавиш, настраивается через "chrome://extensions/shortcuts".

Идеи и предложения по улучшению пишите в "https://github.com/alexiolan/audioknigi.assistant/issues" или на "alex.iolan@gmail.com".

