Лучшая империя - собственная. Нет земель чужих - есть незахваченные!
А что, может ты и есть могущественный и непобедимый король? Если на службе у тебя есть хоть один настоящий эльф, значит, начало положено. Затем, следует нанять пару разъяренных троллей, дюжину драконов, - за ними подтянется еще какой-нибудь сильный, но дружественный монстр. Далее, в помощники тебе нужны самые эпические герои, а клану – альянс с могущественными союзниками. Совсем неплохо для старта головокружительной карьеры!
И вот, родная деревня превратилась в каменный замок, а на башнях запестрели флаги. Добавь побед и немного везения, чтобы под твоей короной сплотилась целая империя!

На пустом месте по краям сайта ВКонтакте можно создавать заметки, чтобы не забывать важные делаТеперь, находясь на сайте Вконтакте, в любом месте можно создавать заметки, и тогда все важные дела будут всегда перед глазами.

Просто выполните следующие шаги:
- создать дело, кликнув соответствующую кнопку в меню расширения (правый верхний угол браузера);
- с помощью календаря установить (или не установить) дату завершения;
- переместить дело на любое удобное место сайта;
- по завершении дела, его можно просто грохнуть.
Кстати, список "убитых" дел можно потом просмотреть на сайте vspomni-delo.ru.

